import React from "react";
import {AppBar, Autocomplete, Tab, Tabs, TextField} from '@mui/material';
import {Box, Toolbar } from '@mui/material';
import MovieIcon from '@mui/icons-material/Movie';
// import  from '@mui/system';


const Header = () => {
    const top100Films=["abc","hshfj","dagf"];
  return (<>
   <AppBar>
    <Toolbar>
        <Box width={"20%"}><MovieIcon/></Box>
        <Box width={"50%"} margin={"auto"}> 
        <Autocomplete id="free-solo-demo" freeSolo options={top100Films.map((option) => option)} renderInput={(params) => <TextField {...params} label="Search Across Multiple Movies" />}/> 
        </Box>
        <Box>
            <Tabs><Tab label="Admin"/></Tabs>
        </Box>
    </Toolbar>
    </AppBar>
    </>
  )
}

export default Header
